    fn deserialize(values: [Field; NOTE_LOG_HASH_LENGTH]) -> Self {
        Self {
            value: values[0],
            counter: values[1] as u32,
            length: values[2],
            note_hash_counter: values[3] as u32,
        }
    }
}

